def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    comment_indent = 0  # Track the indentation level for comments
    for char in prefix:
        current_line += char
        if wait_for_nl:
            if char == '\n':
                if current_line.strip() and current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]

                lines.append(current_line)
                current_line = ""
                current_column = 0
                comment_indent = 0  # Reset comment indentation
                wait_for_nl = False
        elif char == ' ':
            current_column += 1
        elif char == '\t':
            current_column += 4
        elif char == '\n':
            current_column = 0
        elif char == '#':
            comment_indent = current_column  # Track current column for comments
        else:
            wait_for_nl = True
            if comment_indent > current_column:
                diff = comment_indent - current_column
                current_line += ' ' * diff  # Adjust comment indentation

    return ''.join(lines), current_line
